import React, { useState, useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { useParams } from 'react-router-dom';
import axios from 'axios';

export default (props) => {
  const { highlight, navState, proxy, unique_string, version } = useSelector(
    (state) => state
  );
  const { dateGenerator, autoLabel, openTab } = useSelector(
    (state) => state.functions
  );
  const [collections, setCollections] = useState([]);
  const [collection, setCollection] = useState([]);
  const { page_param } = useParams();

  const [pages, setPages] = useState([]);
  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('/path/to/your/ui.json');
        setPages(response.data.pages);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  const criterias = [
    { id: 0, label: 'ALL', value: null },
    { id: 1, label: 'GET', value: 'get' },
    { id: 2, label: 'POST', value: 'post' },
    { id: 3, label: 'PUT', value: 'put' },
    { id: 4, label: 'DELETE', value: 'delete' },
  ];
  const [filter, setFilter] = useState(criterias[0]);

  const dispatch = useDispatch();

  const { urls, bottomUrls } = props;

  const navTrigger = () => {
    dispatch({
      type: 'setNavState',
      payload: {
        navState: !navState,
      },
    });
  };

  const filtingApi = () => {
    let result = [];
    if (filter.value != null) {
      result = collection[filter.value];
    } else {
      const rooms = ['get'];
      rooms.map((room) => {
        if (collection[room]) result = [...result, ...collection[room]];
      });
    }

    return result;
  };

  return (
    <div
      className={`rel navbar z-index-10 ${
        navState ? 'nav-show' : 'nav-hide'
      }`}
    >
      {/* ... */}

      <div className="m-t-2">
        {/* ... */}

        {pages.map((page) => (
          <div
            onClick={() => {
              openTab(`/fetch/${page.param}`);
            }}
            className={`flex flex-no-wrap m-t-0-5 pointer hover ${
              page_param === page.param ? 'highlight' : ''
            }`}
            key={page.id}
          >
            {/* ... */}
          </div>
        ))}
      </div>

      {/* ... */}
    </div>
  );
};
